import React from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';

const Home = () => {
  return (
    <div>
        <Navbar1/>
        <div className="container2">
        <div className="menu">
            <p>fegrd</p>
        </div>
        <div className="devices">
            <p>fegrd</p>
        </div>
        <div className="analytics">
            <p>fegrd</p>
        </div>
        </div>
    </div>
  );
};

export default Home;
